    and Forecast metadata convention (CF) and the Attribute Convention for Data Discovery
    (ACDD). University of Minnesota - Duluth collected the data from their in-situ moored
    station named Station 45028 - Western Lake Superior in the Great Lakes. GLOS, which
    assembles data from University of Minnesota - Duluth and other sub-regional coastal
    and ocean observing systems of the Great Lakes region of the United States, submitted
